import React, { Component } from 'react';
import { Card } from 'react-bootstrap';
import bivakzones from '../bivakzones.json';




export default class WcList extends Component {
    componentDidMount() {
        fetch('http://localhost:3001/w', { properties: { 'Content-Type': 'bivakzones/json' } })
            .then(r => r.json())
            .then(name => {
                this.setState({ name, dog: true });
            });
    }
    render() {
        return (
            <div>
                <Card>

                    <Card.Body>
                        <Card.Title>{bivakzones.properties.name}</Card.Title>
                        <Card.Text>
                            <ul>

                                <li>openfire:{bivakzones.properties.openfire}</li>

                            </ul>
                        </Card.Text>
                    </Card.Body>
                </Card>
            </div>
        )
    }
}
